void MidiRecorderPanel::buttonClicked (Button* buttonThatWasClicked)
{
    //[UserbuttonClicked_Pre]
    //[/UserbuttonClicked_Pre]

    if (buttonThatWasClicked == recordButton)
    {
        //[UserButtonCode_recordButton] -- add your button handler code here..

        if (recorder->isRecording()) {
            recorder->stopRecording();

        }
        else {
            recorder->startRecording();
        }

        //[/UserButtonCode_recordButton]
    }
    else if (buttonThatWasClicked == playButton)
    {
        //[UserButtonCode_playButton] -- add your button handler code here..
        if (recorder->isPlaying()) {
            recorder->stopPlaying();
        }
        else {
            recorder->startPlaying();
        }
        //[/UserButtonCode_playButton]
    }
    else if (buttonThatWasClicked == clearButton)
    {
        //[UserButtonCode_clearButton] -- add your button handler code here..
        recorder->clear();
        //[/UserButtonCode_clearButton]
    }
    else if (buttonThatWasClicked == midiButton)
    {
        //[UserButtonCode_midiButton] -- add your button handler code here..
        //[/UserButtonCode_midiButton]
    }
    else if (buttonThatWasClicked == saveButton)
    {
        //[UserButtonCode_saveButton] -- add your button handler code here..

        FileChooser chooser("Select target file...", File(), "*");

        if (chooser.browseForFileToSave(true)) {
            File file = chooser.getResult();
            MidiFile* midiFile = recorder->getFile();
            std::unique_ptr<FileOutputStream> fos = file.createOutputStream();
            midiFile->writeTo(*fos);
            delete midiFile;
        }


        //[/UserButtonCode_saveButton]
    }
    else if (buttonThatWasClicked == editButton)
    {
        //[UserButtonCode_editButton] -- add your button handler code here..

        DialogWindow::LaunchOptions launchOptions;
        launchOptions.dialogTitle = ("Event editor");
        launchOptions.escapeKeyTriggersCloseButton = true;
        launchOptions.resizable = true;
        launchOptions.useNativeTitleBar = true;
        launchOptions.useBottomRightCornerResizer = true;
        launchOptions.componentToCentreAround = this;
        launchOptions.content.setOwned(editor);
        launchOptions.content->setSize(600, 580);
        launchOptions.runModal();

        //[/UserButtonCode_editButton]
    }

    //[UserbuttonClicked_Post]
    //[/UserbuttonClicked_Post]
}



