void MidiRecorderPanel::log(juce::String message) {

    const juce::String m = message;

    std::function<void(void)> changeLambda =
    [=]() { textEditor->setText(m + "\n"+textEditor->getText()); };
    juce::MessageManager::callAsync(changeLambda);

}

void MidiRecorderPanel::setDeviceManager(juce::AudioDeviceManager *manager) {
    recorder->setDeviceManager(manager);
}

void MidiRecorderPanel::changedState(StateChange *change) {
    switch (change->newState) {
        case RecordListener::State::PLAYING_STARTED:
            playButton->setButtonText("Stop");
            log("playing started. "+change->message);
            break;
        case RecordListener::State::PLAYING_STOPPED:
            playButton->setButtonText("Play");
            log("playing stopped. "+change->message);
            break;
        case RecordListener::State::RECORDING_STARTED:
            recordButton->setButtonText("Stop");
            log("recording started. " +change->message);
            break;
        case RecordListener::State::RECORDING_STOPPED:
            recordButton->setButtonText("Record");
            log("recording stopped. " +change->message);
            editor->update();
            break;
        default:
            break;
    }
}

